const outputString = $input.item.json.output;

// Função para verificar se uma string é JSON válida
const isJSON = (str) => {
  try {
    JSON.parse(str);
    return true;
  } catch {
    return false;
  }
};

// Verificar se o outputString é JSON ou texto simples
let parsedOutput;
if (typeof outputString === 'string' && isJSON(outputString)) {
  // Parsear o JSON válido
  parsedOutput = JSON.parse(outputString);
} else if (typeof outputString === 'string') {
  // Se for texto simples, encapsular como JSON
  parsedOutput = { mensagem: outputString };
} else {
  // Lançar erro se não for uma string ou JSON
  throw new Error('O conteúdo de outputString não é uma string ou JSON válido.');
}

// Verificar se a chave 'mensagem' existe
if (!parsedOutput.mensagem) {
  throw new Error('A chave "mensagem" não foi encontrada no JSON.');
}

// Retornar apenas a mensagem
return {
  json: {
    mensagem: parsedOutput.mensagem,
  },
};
